import React from "react";
import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <header><h1>Milliwonkim</h1></header>
      <nav>
        <li>Portfolio</li>
        <li>YouTube</li>
        <li>Frontend Development</li>
        <li>Android</li>
        <li>iOS</li>
        <li>Contact</li>
      </nav>
    </div>
  );
}
